using System;using System.Collections.Generic;using System.Text.Json.Serialization;namespace MicroFeel.Yonyou.Api{	public class Persontype	{		///<Summary>		///人员类别编码		///</Summary>		[JsonPropertyName("code")]		public string Code { get;set; }		///<Summary>		///人员类别名称		///</Summary>		[JsonPropertyName("name")]		public string Name { get;set; }		///<Summary>		///级别		///</Summary>		[JsonPropertyName("levels")]		public string Levels { get;set; }		///<Summary>		///上级编码		///</Summary>		[JsonPropertyName("pcodeid")]		public string Pcodeid { get;set; }		///<Summary>		///是否有下级（0：否  1：是）		///</Summary>		[JsonPropertyName("childflag")]		public string Childflag { get;set; }		///<Summary>		///备注		///</Summary>		[JsonPropertyName("memo")]		public string Memo { get;set; }	}}